import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
  root: {
    width: 450,
    marginTop: theme.spacing(3),
  },
  titulo: {
  	textAlign: 'center',
  	marginTop: theme.spacing(2),
  },
  button: {
  	textAlign: 'center',
  	marginTop: theme.spacing(2), 
  }
}))
